import React from 'react';
import L from 'leaflet';

const Map = () => {
  React.useEffect(() => {
    const map = L.map('map').setView([51.505, -0.09], 13);
    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png').addTo(map);
  }, []);

  return <div id="map" style={{ height: '400px' }}>{map}</div>;
};

export default Map;
